import React from 'react';
import {
  Box,
  UnorderedList,
  ListItem,
  ModalBody,
  Image,
  Button,
  Link,
  HStack,
  useColorModeValue,
  Code,
  Heading,
} from '@chakra-ui/react';

import { BsFileEarmarkCode } from 'react-icons/bs';

const Webapps = () => {
  return (
    <Box mt={2}>
      <ModalBody>
        <Button
          //   leftIcon={<FaGooglePlay />}
          //   colorScheme={firstColor}
          size="lg"
          mr={5}
        >
          <Link>Research Paper</Link>
        </Button>
        <Button
          //   leftIcon={<FaGooglePlay />}
          //   colorScheme={firstColor}
          size="lg"
          mr={5}
        >
          Try Now
        </Button>

        <Button leftIcon={<BsFileEarmarkCode />} colorScheme="blue" size="lg">
          <Link>View Source Code</Link>
        </Button>
      </ModalBody>
    </Box>
  );
};

export default Webapps;
